import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [titles, setTitles] = useState([]);

  useEffect(() => {
    let data = [];
    const key = '85062f74bccf4b33872bf17c11caaae6';
    const url = `https://newsapi.org/v2/everything?q=tesla&from=2021-10-20&sortBy=publishedAt&apiKey=${key}`;

    fetch(url)
      .then((response) => response.json())
      .then((response) => {
        console.log(response.articles);
        data.push(response.articles);
      });

    setTitles(data);
  }, [titles]);

  return (
    <div className='App'>
      <h1>Hey</h1>
      <ul>
        {titles.map((data) => {
          return <li>{data.title}</li>;
        })}
      </ul>
    </div>
  );
}

export default App;
